import React from 'react';
import Layout from '../components/Layout'
const NuevaCuenta = () => {
    return (  
        <>
            <Layout>
                <h1>Nueva Cuenta</h1>
            </Layout>
        </>
    );
}
 
export default NuevaCuenta;
